import getUniquieId from "../functions/getUniqueId";

/*
    icon: "üç™",
    prdName: "Butter Biscuit",
    prdPrice: "10",
*/

class Product {
  constructor(name, prdName, prdPrice) {
    this.icon = prdName;
    this.prdName = name;
    this.prdPrice = prdPrice;
  }
  getProduct() {
    return {
      id: getUniquieId(),
      icon: this.icon,
      prdName: this.prdName,
      prdPrice: this.prdPrice,
    };
  }
}

export default Product;
